import React from "react";
import { Redirect, Route, Switch } from "react-router-dom";
import { useSubheader } from "../../../_metronic/layout";
import AccountInformation from "./AccountInformation";
import { ProfileOverview } from "./ProfileOverview";
import ChangePassword from "./ChangePassword";
import PersonaInformation from "./PersonaInformation";
import EmailSettings from "./EmailSettings";
import { ProfileCard } from "./components/ProfileCard";

export default function DoctorAvailablepage() {
  const suhbeader = useSubheader();
  suhbeader.setTitle("User profile");

  return (

    <div className="d-flex flex-row">
      <div className="d-flex flex-row">
        test
      </div>
      <div className="d-flex flex-row">
        <ProfileCard></ProfileCard>
        <div className="flex-row-fluid ml-lg-8">
          <Switch>
            <Redirect
              from="/doctor-available"
              exact={true}
              to="/doctor-available/profile-overview"
            />
            <Route
              path="/doctor-available/profile-overview"
              component={ProfileOverview}
            />
            <Route
              path="/doctor-available/account-information"
              component={AccountInformation}
            />
            <Route
              path="/doctor-available/change-password"
              component={ChangePassword}
            />
            <Route
              path="/doctor-available/email-settings"
              component={EmailSettings}
            />
            <Route
              path="/doctor-available/personal-information"
              component={PersonaInformation}
            />
          </Switch>
        </div>
      </div>
    </div>
  );
}
